
public class Oak extends Plant{
	public Oak()
	{
	}
	
	public Oak(final String name)
	{
		super(name);
	}
	

	@Override
	public String phylum() {
		// TODO Auto-generated method stub
		return "Magnoliophyta";
	}

	@Override
	public String clss() {
		// TODO Auto-generated method stub
		return "Magnliopsida";
	}

	@Override
	public String type() {
		// TODO Auto-generated method stub
		return "oak";
	}
}


